import React from 'react';
import '../styles/knowledge.css'
import { motion } from 'framer-motion';

const variants = {
    hidden: {opacity: 0},
    show: {
        opacity: 1,
        transition: {
            staggerChildren: 0.2,
        },
    },
}
const item = {
    hidden: {
        opacity: 0,
        x: 50
    },
    show:{
        opacity: 1,
        x: 0,
        transition :{
            duration: 0.8,
        },
    },
};

export const Knowledge = () => {
  return (
    <div className='container_ppal_project'>
        <motion.h2 className='subtitulo' initial={{y: -150}} animate={{y:-10}} transition={{delay: 0.1, type: 'spring', stiffness: 75}}>Conocimientos</motion.h2>
        <motion.div className='list_knowledge' initial={{opacity: 0}} animate={{opacity: 1}} transition={{delay: 0.5, duration: 0.5}}>
            <motion.ul className='section_knowledge' variants={variants} initial="hidden" animate="show">
                <motion.div className='card_knowledge' variants={item}>
                    <h3 className='tittle_card'>HTML</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge'variants={item}>
                    <h3 className='tittle_card'>CSS</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge'variants={item}>
                    <h3 className='tittle_card'>Javascript</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge'variants={item}>
                    <h3 className='tittle_card'>React.js</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge' variants={item}>                    <h3 className='tittle_card'>Node.js</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge' variants={item}>                    <h3 className='tittle_card'>Typescript</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge' variants={item}>                            <h3 className='tittle_card'>Java</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge' variants={item}>                            <h3 className='tittle_card'>MySQL</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge' variants={item}>                            <h3 className='tittle_card'>Git</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
                <motion.div className='card_knowledge' variants={item}>                            <h3 className='tittle_card'>C</h3>
                    <img className='icon_inside' src={require('../image/icon.png')} alt='icon'></img>
                    {/* <button className='button_card'>Ver Certificado</button> */}
                </motion.div>
            </motion.ul>
        </motion.div>

    </div>
  )
}
